import React from "react";
import { Switch, Route } from "react-router-dom";
import { LandingPage } from "./components/LandingPage";

const ApplicationViews = () => {
  return (
    <Switch>
      <Route path="/" exact>
        <LandingPage />
      </Route>
    </Switch>
  );
};

export default ApplicationViews;
